
require "scanf.rb"

def mod(x, y)
  return x - y * (x.to_f / y).to_i
end

=begin
 lit un sudoku sur l'entrée standard 
=end

def read_sudoku(  )
    a = 9 * 9
    out_ = [];
    for i in (0 ..  a - 1) do
      k = 0
      k=scanf("%d")[0];
      scanf("%*\n");
      out_[i] = k;
    end
    return (out_);
end


=begin
 affiche un sudoku 
=end

def print_sudoku( sudoku_ )
    for y in (0 ..  8) do
      for x in (0 ..  8) do
        b = sudoku_[x + y * 9]
        printf "%d ", b
        if (mod(x, 3)) == 2 then
          print " ";
        end
      end
      print "\n";
      if (mod(y, 3)) == 2 then
        print "\n";
      end
    end
    print "\n";
end


